import React, { Fragment } from "react";
import { BrowserRouter, Router, Route, Switch } from "react-router-dom";
import Navbar from "./components/layout/Navbar";
import "./App.css";

const App = props => {
  return (
    <Router>
      <Fragment>
        <div className="App">
          <Navbar />
          <h1>My App</h1>
        </div>
      </Fragment>
    </Router>
  );
};

export default App;
